import React,{useState} from 'react'
import '../css/Client_dashboard.css'
import {useNavigate} from 'react-router-dom'


export default function Client_dashboard() {
    const navigate=useNavigate();
   const doctors = [
      {
        index: 0,
        name: 'Dr. Smith',
        image: 'data:image/jpeg;base64,',
        Qualification:"MBBS" 
      },{
         index: 1,
         name: 'Dr. Smith',
         image: 'data:image/jpeg;base64,',
         Qualification:"MBBS" 
       },{
         index: 2,
         name: 'Dr. Smith',
         image: 'data:image/jpeg;base64,',
         Qualification:"MBBS" 
       }
   ]

 const openPopup=async(i)=>{
   console.log(i)
   const currentDate = new Date();


   const numberOfDaysToAdd = 7;
   const futureDate = new Date(currentDate);
   futureDate.setDate(currentDate.getDate() + numberOfDaysToAdd);
   const isoFutureDateString = futureDate.toISOString();

   const numberOfHoursToAdd = 2;
   const futureTime = new Date(currentDate);
    futureTime.setHours(currentDate.getHours() + numberOfHoursToAdd);
    const isoFutureTimeString = futureTime.toISOString();


   return alert(`Appointment of ${futureDate} `)

   const res = await fetch('http://localhost:5000/api/registration', {
      method: 'POST',
      crossDomain: true,
      headers: {
          'content-Type': 'application/json',
          Accept: 'application/json',
          'Access-Control-Allow-Origin': '*',
      },
      body: JSON.stringify({
          index:i,
         date:isoFutureDateString,
         time:isoFutureTimeString 
          
      }),

      
  });


  const data = await res.json();
  console.log(res.status);
  console.log(data);
  
  window.alert('Registration successful');
//   if (res.status === 422) {
//        alert(`${data.error}`);
        
//   } else if (res.status === 200) {
//       window.alert('Registration successful');
      
//   } else {
//       console.error('Unexpected error during registration. Please try again');
//   }
 }
  return (
    <>
      <header className='header'>
               <div>
                 HEALTH APP
               </div>
      </header>
      
      <main>
         <div className='doctors_data' >

         {doctors.map((doctor, index) => (
        <div key={index} className="doctors_data">
          <button onClick={() => openPopup(index)}>
            <div>
              <img src={doctor.image} alt="Doctor image" />
            </div>
            <div>
              <b>{doctor.name}</b>
              <p>{doctor.Qualification}</p>
              
            </div>
          </button>
        </div>
      ))}
         </div>
         
      </main>
    </>
  )
}
